import React, { Component } from 'react';
import { FacebookProvider, Group } from 'react-facebook';


export default class Example extends Component {
  render() {
    return (
      <FacebookProvider appId="1747983188680794">
        <Group
          href="https://www.facebook.com/groups/1389776634498901"
          width="300"
          showSocialContext={true}
          showMetaData={true}
          skin="light"
        />
      </FacebookProvider>    
    );
  }
}
